            var dfDbTypeList = new List<Domain.DbType>
            {
                new Domain.DbType {  Name="Oracle",Remark="Oracle" },
                new Domain.DbType {  Name="Db2", Remark= "Db2"},
                new Domain.DbType {  Name="MySql", Remark= "MySql"},
                new Domain.DbType {  Name="SqlServer", Remark= "SqlServer"}
            };
            foreach (var type in dfDbTypeList)
            {
                if (_context.DbType.Any(p => p.Name == type.Name))
                {
                    break;
                }
                else
                {
                    _context.DbType.Add(type);
                }
                _context.SaveChanges();
            }
            #endregion

            #region 添加本地库标识类
            var defaultDbTag = _context.DbTag.FirstOrDefault(p => p.Name == "本地库");
            if (defaultDbTag == null)
            {
                defaultDbTag = new Domain.DbTag { Name = "本地库", Remark = "本地库" };
                _context.DbTag.Add(defaultDbTag);
                _context.SaveChanges();
            }
            #endregion

          

