                    ByName = "本地中心库",
                    DbTag = defaultDbTag,
                    DbTypeId = 1,//1=Oracle 2=Db2 3=MySql 4=SqlServer
                    //Ip = "139.196.212.68",
                    Ip = "127.0.0.1",
                    Port = 1521,
                    DataCase = "ORCL",
