                    IsPlaceholder =false,
                    Remark="",
                   Sql=string.Format(@"select a.id,b.name type_name,c.name define_name,c.code define_code,a.title,a.SUMMARY,a.info,
                                       decode(a.is_use,1,'在用','停用') is_use,
                                       decode(a.is_urgent,1,'是','否') is_urgent,
                                       a.create_time 
                                       from EM_CONTENT a 
                                       left join EM_CONTENT_TYPE b on (a.DEFINE_TYPE_ID=b.id) 
                                       left join EM_DEFINE c on (b.DEFINE_ID=c.id) 
                                       left join em_define_config d on (d.define_id=c.id)
                                       where a.IS_DELETE<>1 and is_use=1 

                                       and  {0}   in 
                                       (
                                       select aa.id from abp_users aa  where 1=1 and 
                                      ((select IS_CHECK_USER from em_define_config where define_id=(select define_id from em_content where id=a.id )) =0 and 1=1 ) 
                                      or 
                                      ((select IS_CHECK_USER from em_define_config where define_id=(select define_id from em_content where id=a.id )) =1 and
                                      aa.id in 
                                     (
                                     select abp_users.id from abp_users   where abp_users.id not in (select user_id from em_content_user where  content_id=a.id and is_allow=0)
                                     and  
                                     ((select em_content_check.is_check_user from em_content_check where content_id=a.id  ) =1 and 1=1 ) 
                                     or 
                                     (
                                     (select em_content_check.is_check_user from em_content_check where content_id=a.id  ) =0 and 
                                     aa.id in (select user_id from em_content_user where  content_id=a.id and is_allow=1)
                                     ) 
                                     )
                                     )
                             intersect 
                            select ab.id from abp_users ab  where 1=1 and 
                           ((select IS_CHECK_role from em_define_config where define_id=(select define_id from em_content where id=a.id )) =0 and 1=1 ) 
                           or 
                           ((select IS_CHECK_role from em_define_config where define_id=(select define_id from em_content where id=a.id )) =1 and 
 
                          ab.id in 
                          (
                          select abp_users.id from abp_users   where abp_users.id not in 
                          (select user_id from abp_user_roles where role_id in(select role_id from em_content_role where  content_id=a.id and is_allow=0))
                           and  
                         ((select em_content_check.is_check_role from em_content_check where content_id=a.id  ) =1 and 1=1 ) 
                          or 
                           (
                         (select em_content_check.is_check_role from em_content_check where content_id=a.id  ) =0 and 
                           ab.id in (select user_id from abp_user_roles where role_id in(select role_id from em_content_role where  content_id=a.id and is_allow=1))
                             ) 

                            )
                            )
                          intersect 
                            select ac.id from abp_users ac  where 1=1 and 
                            ((select IS_CHECK_district from em_define_config where define_id=(select define_id from em_content where id=a.id )) =0 and 1=1 ) 
                             or 
                          ((select IS_CHECK_district from em_define_config where define_id=(select define_id from em_content where id=a.id )) =1 and 
 
                           ac.id in 
                           (
                           select abp_users.id from abp_users   where abp_users.id not in 
                          (select abp_users.id from abp_users where abp_users.district_id in (select district_id from em_content_district where  content_id=a.id and is_allow=0))
                           and  
                           ((select em_content_check.is_check_district from em_content_check where content_id=a.id  ) =1 and 1=1 ) 
                            or 
                                  (
                               (select em_content_check.is_check_district from em_content_check where content_id=a.id  ) =0 and 
                             ac.id in (select abp_users.id from abp_users where abp_users.district_id in (select district_id from em_content_district where  content_id=a.id and is_allow=1))
                        ) 
                         )
                         )
                        )

                      order by a.id desc ","@{USER_ID}")
                },

